#8211; Fix organization tab e2e tests #45692 <a href=\"https://github.com/woocommerce/woocommerce/pull/45692\" rel=\"nofollow ugc\">#45692</a></li>\n<li>Fix &#8211; Fix styling issue for the Price Filter block preventing fields from appearing inline when the Inline input fields option is enabled <a href=\"https://github.com/woocommerce/woocommerce/pull/45197\" rel=\"nofollow ugc\">#45197</a></li>\n<li>Fix &#8211; Fix the customer list e2e test for PR merge workflow <a href=\"https://github.com/woocommerce/woocommerce/pull/45229\" rel=\"nofollow ugc\">#45229</a></li>\n<li>Fix &#8211; Gracefully handle posts to HPOS redirect when backup post no longer exists. <a href=\"https://github.com/woocommerce/woocommerce/pull/45605\" rel=\"nofollow ugc\">#45605</a></li>\n<li>Fix &#8211; Include simple product support in the attributes filter within the analytics orders view. <a href=\"https://github.com/woocommerce/woocommerce/pull/44901\" rel=\"nofollow ugc\">#44901</a></li>\n<li>Fix &#8211; Make sure backup posts are restored during sync when HPOS is enabled. <a href=\"https://github.com/woocommerce/woocommerce/pull/45332\" rel=\"nofollow ugc\">#45332</a></li>\n<li>Fix &#8211; Normalize Slots on Settings pages by creating scopes for each page that has a Slot <a href=\"https://github.com/woocommerce/woocommerce/pull/45152\" rel=\"nofollow ugc\">#45152</a></li>\n<li>Fix &#8211; Prevent fatal error when updating HPOS setting without changing value. <a href=\"https://github.com/woocommerce/woocommerce/pull/45604\" rel=\"nofollow ugc\">#45604</a></li>\n<li>Fix &#8211; Prevent possible type error during install routine. <a href=\"https://github.com/woocommerce/woocommerce/pull/45730\" rel=\"nofollow ugc\">#45730</a></li>\n<li>Fix &#8211; Prevent user interaction with the Product Filter: Price (Beta) block within the Editor. <a href=\"https://github.com/woocommerce/woocommerce/pull/45602\" rel=\"nofollow ugc\">#45602</a></li>\n<li>Fix &#8211; Product Elements: fix some warning thrown when there was no post ID available <a href=\"https://github.com/woocommerce/woocommerce/pull/45675\" rel=\"nofollow ugc\">#45675</a></li>\n<li>Fix &#8211; Product results count block update with product collection pagination &amp; filtering. <a href=\"https://github.com/woocommerce/woocommerce/pull/45556\" rel=\"nofollow ugc\">#45556</a></li>\n<li>Fix &#8211; Rename ProductTemplate namespace #45594 <a href=\"https://github.com/woocommerce/woocommerce/pull/45594\" rel=\"nofollow ugc\">#45594</a></li>\n<li>Fix &#8211; Reset Product Collection block pagination when filters change. <a href=\"https://github.com/woocommerce/woocommerce/pull/45693\" rel=\"nofollow ugc\">#45693</a></li>\n<li>Fix &#8211; Tax task  &#8211; do not require postcode input for countries without postcode. <a href=\"https://github.com/woocommerce/woocommerce/pull/45367\" rel=\"nofollow ugc\">#45367</a></li>\n<li>Fix &#8211; Use regular_price to determine if product is not sale and don&#8217;t rely only on price for product_meta_lookup <a href=\"https://github.com/woocommerce/woocommerce/pull/43011\" rel=\"nofollow ugc\">#43011</a></li>\n<li>Fix &#8211; Using ActionScheduler to schedule fetching of in-app marketplace promotions. <a href=\"https://github.com/woocommerce/woocommerce/pull/45628\" rel=\"nofollow ugc\">#45628</a></li>\n<li>Fix &#8211; [CYS] Fix the intro path when exiting the assembler. <a href=\"https://github.com/woocommerce/woocommerce/pull/44771\" rel=\"nofollow ugc\">#44771</a></li>\n<li>Fix &#8211; [CYS] Improve logic to ensure that the font is active. <a href=\"https://github.com/woocommerce/woocommerce/pull/45385\" rel=\"nofollow ugc\">#45385</a></li>\n<li>Add &#8211; Displays a red badge on in-app My Subscriptions tab if Woo.com Update Manager is not installed or activated <a href=\"https://github.com/woocommerce/woocommerce/pull/46088\" rel=\"nofollow ugc\">#46088</a></li>\n<li>Add &#8211; &lt;!&#8211; Add a changelog message here &#8212;  Add launch_your_store feature flag 