11; Adds Checkout additional fields to the store weekly snapshot. <a href=\"https://github.com/woocommerce/woocommerce/pull/44310\" rel=\"nofollow ugc\">#44310</a></li>\n<li>Add &#8211; Add tests for variable product #44818 <a href=\"https://github.com/woocommerce/woocommerce/pull/44818\" rel=\"nofollow ugc\">#44818</a></li>\n<li>Add &#8211; Add the ability to search for a currency by ISO code. <a href=\"https://github.com/woocommerce/woocommerce/pull/45512\" rel=\"nofollow ugc\">#45512</a></li>\n<li>Add &#8211; Add the <code>woocommerce_guest_session_to_user_id</code> action hook that fires when a guest session is migrated to a customer ID <a href=\"https://github.com/woocommerce/woocommerce/pull/45146\" rel=\"nofollow ugc\">#45146</a></li>\n<li>Add &#8211; Add totalValue filter. <a href=\"https://github.com/woocommerce/woocommerce/pull/45170\" rel=\"nofollow ugc\">#45170</a></li>\n<li>Add &#8211; Add used meta keys dropdown in HPOS custom fields metabox. <a href=\"https://github.com/woocommerce/woocommerce/pull/44739\" rel=\"nofollow ugc\">#44739</a></li>\n<li>Add &#8211; Add xstate scaffold for Launch your store feature <a href=\"https://github.com/woocommerce/woocommerce/pull/45548\" rel=\"nofollow ugc\">#45548</a></li>\n<li>Add &#8211; Add <code>woocommerce_order_hold_stock_minutes</code> filter hook to allow the number of minutes stock in an order should be reserved for to be filtered. <a href=\"https://github.com/woocommerce/woocommerce/pull/45246\" rel=\"nofollow ugc\">#45246</a></li>\n<li>Add &#8211; Allow &#8211;re-migrate to work without &#8211;verbose in HPOS CLI verification tool. <a href=\"https://github.com/woocommerce/woocommerce/pull/44669\" rel=\"nofollow ugc\">#44669</a></li>\n<li>Add &#8211; Customize Your Store: Add the color palettes for the Nokul, Highline and Luminate themes in the intro screen. <a href=\"https://github.com/woocommerce/woocommerce/pull/45105\" rel=\"nofollow ugc\">#45105</a></li>\n<li>Add &#8211; Customize Your Store: Introdu