(70, 1, '2024-05-07 07:38:39', '2024-05-07 07:38:39', 'ZOO GOOD Puppy Beef and Chicken är ett spannmålsfritt våtfoder för valpar av alla raser upp till 12 månader samt för dräktiga/digivande tikar. Receptet innehåller kyckling och vit fisk tillagat i sin egen köttsaft vilket gör den exceptionellt smaklig. Hög protein- och fetthalt. Omega-3 fettsyror (DHA) för utveckling av valpens kognitiva funktioner. Kan användas som helfoder eller som smaskig topping. 400 g\r\n\r\nInnehåller: Kött och animaliska biprodukter 39% (19% kycklinghjärtan, 10% kycklingkött, 10% kycklingmagar), fisk och fiskbiprodukter 26% (vit fisk), laxolja 2%, ärtmjöl 2%, lignocellulosa 0.7%, kalciumkarbonat 0.3%', 'Dog Puppy Beef/Chicken Burk', '', 'publish', 'open', 'closed', '', 'dog-puppy-beef-chicken-burk', '', '', '2024-05-07 07:38:39', '2024-05-07 07:38:39', '', 0, 'http://petpalace.test/?post_type=product&#038;p=70', 0, 'product', '', 0),
