(73, 1, '2024-05-07 07:44:47', '2024-05-07 07:44:47', 'ZOO GOOD Lamb är ett spannmålsfritt våtfoder för vuxna hundar med lamm som enda proteinkälla (kött, lever, hjärta och lungor). Maten har en lite högre energihalt vilket gör den lämplig för mer aktiva hundar eller matvägrare. Fodret är tillagat i sin egen köttsaft vilket gör det exceptionellt smakligt. Kan användas som helfoder eller som smaskig topping. 400 g\r\n\r\nInnehåller: Protein: 10% - Fett: 8% - Råaska: 2.5% - Råfibrer: 0.7% - Vatten: 78% - Kalcium: 0.25%, Fosfor: 0.2% - Omega-3 fettsyror: 0.10%', 'Dog Adult Lamb Burk', '', 'publish', 'open', 'closed', '', 'dog-adult-lamb-burk', '', '', '2024-05-07 07:44:48', '2024-05-07 07:44:48', '', 0, 'http://petpalace.test/?post_type=product&#038;p=73', 0, 'product', '', 0),
