(76, 1, '2024-05-07 07:53:16', '2024-05-07 07:53:16', 'Anallergenic torrfoder är ett dietiskt helfoder för hundar, som är utvecklat för minskad intolerans mot ingredienser och näringsämnen. Hydrolyserade proteinkällor och utvalda kolhydratkällor. REKOMMENDATION: veterinär bör rådfrågas före användning och före en förlängning av användningstiden. Använd Anallergenic torrfoder 3 till 8 veckor: om tecknen på intolerans försvinner, kan detta foder inledningsvis användas i upp till ett år.\r\n\r\nInnehåller: Protein 18,0 %, Fettinnehåll 16,5 %, Råaska 6,2 %, Växttråd 2,0 %, Essentiell fettsyra (linolsyra) 2,6 %.', 'Dog Allergy Management', '', 'publish', 'open', 'closed', '', 'dog-allergy-management', '', '', '2024-05-07 07:53:16', '2024-05-07 07:53:16', '', 0, 'http://petpalace.test/?post_type=product&#038;p=76', 0, 'product', '', 0),
