(86, 1, '2024-05-07 08:02:40', '2024-05-07 08:02:40', 'My favourite dog Bones with lamb är smaskiga, mjuka belöningsgodisar för hundar av alla raser. Smaksatta med lamm är de oemotståndliga även för de mest kräsna hundarna. De är perfekta till din dagliga träning eller som belöning på hundpromenaden. My favourite dog Bones with lamb innehåller naturligtvis inget tillsatt socker, de går utmärkt att använda i aktiveringsleksaker och de levereras i en praktisk hink (i återvinningsbar plast) som gör att godisarna håller sig mjuka längre.\r\n\r\nSpannmål, derivater av vegetabiliskt ursprung, kött och animaliska biprodukter (minst 4% lamm), oljor och fetter, extrakt av vegetabiliskt protein, propylenglykol', 'Bones With Lamb', '', 'publish', 'open', 'closed', '', 'bones-with-lamb', '', '', '2024-05-07 08:04:18', '2024-05-07 08:04:18', '', 0, 'http://petpalace.test/?post_type=product&#038;p=86', 0, 'product', '', 0),
