(91, 1, '2024-05-07 08:10:29', '2024-05-07 08:10:29', 'Höna - Lång plyschleksak som är idealisk för dragkampslekar &amp; ruskande. Hundleksaken har inre strukturerad nacke för naturliga tugginstinkter. Lågtonspip &amp; förstärkt plyschdesignen håller hundar roade lekfulla länge. Perfekt för apporteringslekar med hunden. Kong Shakers Honkers Hen Dog Toy.', 'Shakers Honkers Hen Dog Toy', '', 'publish', 'open', 'closed', '', 'shakers-honkers-hen-dog-toy', '', '', '2024-05-07 08:13:04', '2024-05-07 08:13:04', '', 0, 'http://petpalace.test/?post_type=product&#038;p=91', 0, 'product', '', 0),
