(93, 1, '2024-05-07 08:12:18', '2024-05-07 08:12:18', 'Björn - Gulligt mjukisdjur \"kiddos bear\" till hunden från KONG. Mjukisbjörnen passar perfekt för långa lek &amp; mysstunder. Praktisk pipfunktion som du enkelt kan ta bort om du önskar lugn &amp; ro medan hunden leker. Sätt i pipfunktionen igen om du önskar att hunden ska få lite extra rolig lek med pipljud. Kong Comfort Kiddos Bear Black Large Dog Toy', 'Comfort Kiddos Bear Black Large', '', 'publish', 'open', 'closed', '', 'comfort-kiddos-bear-black-large', '', '', '2024-05-07 08:14:08', '2024-05-07 08:14:08', '', 0, 'http://petpalace.test/?post_type=product&#038;p=93', 0, 'product', '', 0),
