(95, 1, '2024-05-07 09:12:29', '2024-05-07 09:12:29', 'Våra små minitigrar är strikta köttätare och behöver ha ett  foder anpassat därefter. Denna blötmat innehåller mycket gott och lättsmält kött från kalkon och lax. Dessutom innehåller blötmaten andra naturliga ingredienser som främjar kattens välbefinnande:\r\n<ul>\r\n 	<li>Omega-3 fettsyror från linfröolja främjar en frisk hud och glansig päls samt hjärnan och synens normala funktion</li>\r\n 	<li>Innehåller näringsrikt och lättsmält kött som också gör maten särskilt välsmakande</li>\r\n 	<li>Zink och biotin främjar hud och päls</li>\r\n 	<li>Tranbär främjar friska urinvägar</li>\r\n 	<li>Helt spannmål- och potatisfri</li>\r\n 	<li>Innehåller inga artificiella smaker, färgämnen eller konserveringsmedel</li>\r\n</ul>', 'Kitten Turkey & Salmon', '', 'publish', 'open', 'closed', '', 'turkey-salmon', '', '', '2024-05-07 09:24:00', '2024-05-07 09:24:00', '', 0, 'http://petpalace.test/?post_type=product&#038;p=95', 0, 'product', '', 0),
