(97, 1, '2024-05-07 09:21:16', '2024-05-07 09:21:16', 'Free Range Chicken är ett torrfoder som är speciellt framtagen för att vara helt spannmålsfritt. Kötthalten är över 65% och består utav kyckling för att erbjuda en proteinrik diet som din katt kommer må bra av. Free Range Chicken ger din katt mycket näring och innehåller få kolhydrater, inget spannmål och en hel drös med välgörande grönsaker och växter för att efterlikna kattens naturliga föda. Kyckling är en utmärkt källa för protein, vitaminer, fosfor och selen - samtliga stärker immunsystemet! Sötpotatis är en lättsmält energikälla som tas upp långsamt, rik på antioxidanter och en utmärkt källa för fiber. Sjögräs ger en naturlig och värdefull mineralkälla som bland annat kontrollerar metabolismen hos din katt. Ringblomma, tranbär och kamomill stimulerar produkten av vita blodkroppar och stärker immunförsvaret samtidigt som de har en rogivande effekt för att reducera stress.', 'Cat Free Range Chicken', '', 'publish', 'open', 'closed', '', 'cat-free-range-chicken', '', '', '2024-05-07 09:28:58', '2024-05-07 09:28:58', '', 0, 'http://petpalace.test/?post_type=product&#038;p=97', 0, 'product', '', 0),
