(102, 1, '2024-05-07 09:28:22', '2024-05-07 09:28:22', 'Med vår filosofi återvänder vi till katternas naturliga ursprung där animaliska proteinkällor står i centrum vid utfodringen. Kitten Lax &amp; Kalkon är ett helt spannmåls- och potatisfritt helfoder med lax för växande kattungar (1-12 månader). Fodret innehåller allt din kattunge behöver för en sund utveckling och tillväxt och för att den ska kunna leva ett långt och friskt liv. Lax är en animalisk proteinkälla som få katter är allergiska mot, det är mycket lättsmält, mycket smakligt och brukar falla de flesta katter i smaken. Lax och kalkon är goda källor till lättsmälta proteiner och lax är rik på är omättade Omega 3-fettsyror som hjälper till förbättra utseende och kvalitet på hud och päls. Fodret är även berikat med skogsbär, grönsaker och örter som underlättar matsmältningen och hjälper till att gynna en god tarmflora. Fodret bidrar till en god utveckling av skelett, muskler och immunförsvar. Alla vår foder är helt fria från kemikalier, konserveringsmedel och färgämnen. Finns i tre olika förpackningsstorlekar, 400 g, 2 kg samt 6 kg.', 'Kitten Lax & Kalkon', '', 'publish', 'open', 'closed', '', 'kitten-lax-kalkon', '', '', '2024-05-07 09:28:46', '2024-05-07 09:28:46', '', 0, 'http://petpalace.test/?post_type=product&#038;p=102', 0, 'product', '', 0),
