(107, 1, '2024-05-07 09:32:33', '2024-05-07 09:32:33', 'Ett högkvalitativt, spannmålsfritt kattgodis. Godiset har högt köttinnehåll och innehåller antioxidanter.\r\n\r\nDin vän bör ha en balanserad kost där godis enbart utgör en liten del av dess dagliga intag. Även om din bästa vän är en gottegris är det ditt jobb att se till att den håller sig hälsosam. Nosa reda på rekommendationer på baksidan av förpackningarna och kom ihåg att kattens storlek påverkar intaget.', 'Cat Snack Chicken & Thyme', '', 'publish', 'open', 'closed', '', 'cat-snack-chicken-thyme', '', '', '2024-05-07 09:32:33', '2024-05-07 09:32:33', '', 0, 'http://petpalace.test/?post_type=product&#038;p=107', 0, 'product', '', 0),
