(109, 1, '2024-05-07 09:36:54', '2024-05-07 09:36:54', 'Våtfoder med mört kycklingbröst och nötkött i gelé med hög smaklighet och smältbarhet. Ett naturligt kompletteringsfoder för den vuxna katten. Innehåller inga konstgjorda tillsatser, smakämnen eller konserveringsmedel. Komplettera med andra våtfoder och torrfoder för en balanserad diet. Se alltid till att din katt har tillgång till färskt vatten.', 'Kyckling & Biff i Gelé', '', 'publish', 'open', 'closed', '', 'kyckling-biff-i-gele', '', '', '2024-05-07 09:37:08', '2024-05-07 09:37:08', '', 0, 'http://petpalace.test/?post_type=product&#038;p=109', 0, 'product', '', 0),
