(111, 1, '2024-05-07 09:44:41', '2024-05-07 09:44:41', 'En enkel klöspelare Piko för mindre katter. En klöspelare är perfekt för katter att vässa sina klor på och sparar på så sätt din heminredning och andra föremål. Dessutom har Piko klöspelaren hängande leksaker som gör det extra roligt för katten. Färg: Rosa. Mått:  H 47 x Ø 31 x cm', 'Klöspelare Piko Rosa', '', 'publish', 'open', 'closed', '', 'klospelare-piko-rosa', '', '', '2024-05-07 09:54:23', '2024-05-07 09:54:23', '', 0, 'http://petpalace.test/?post_type=product&#038;p=111', 0, 'product', '', 0),
