(113, 1, '2024-05-07 09:50:58', '2024-05-07 09:50:58', 'Ett vackert sagoslott med slottstrappa och tre mysiga utkikstorn erbjuder den fyrbenta kungliga högheten en mängd liggplatser!\nI det stora sovhuset har också stora kattraser tillräckligt med plats att dra sig tillbaka på.\n\nDe extra stora, delade klösstammarna med sisal är perfekta att vässa klorna på och katten kan tänja sig ordentligt. Dessutom är stammarna roliga att klättra på, och i hushåll med flera katter är de omtyckta för spännande jaktlekar. En slottstrappa med plysch leder från taket på det stora sovhuset till ett annat hus en våning högre, lite mindre i storlek. De två slottstornen har var sin vadderad utkiksplattform med en kant att luta sig mot. Härifrån kan katten bekvämt ha kungariket under uppsikt.', 'Paradise Klösträd', '', 'trash', 'open', 'closed', '', '__trashed', '', '', '2024-05-07 09:50:58', '2024-05-07 09:50:58', '', 0, 'http://petpalace.test/?post_type=product&#038;p=113', 0, 'product', '', 0),
