(115, 1, '2024-05-07 09:53:42', '2024-05-07 09:53:42', 'Ett vackert sagoslott med slottstrappa och tre mysiga utkikstorn erbjuder den fyrbenta kungliga högheten en mängd liggplatser!\r\nI det stora sovhuset har också stora kattraser tillräckligt med plats att dra sig tillbaka på.\r\n\r\nDe extra stora, delade klösstammarna med sisal är perfekta att vässa klorna på och katten kan tänja sig ordentligt. Dessutom är stammarna roliga att klättra på, och i hushåll med flera katter är de omtyckta för spännande jaktlekar. En slottstrappa med plysch leder från taket på det stora sovhuset till ett annat hus en våning högre, lite mindre i storlek. De två slottstornen har var sin vadderad utkiksplattform med en kant att luta sig mot. Härifrån kan katten bekvämt ha kungariket under uppsikt.', 'Paradise Klösträd', '', 'publish', 'open', 'closed', '', 'paradise-klostrad', '', '', '2024-05-07 09:54:00', '2024-05-07 09:54:00', '', 0, 'http://petpalace.test/?post_type=product&#038;p=115', 0, 'product', '', 0),
