(120, 1, '2024-05-07 10:01:32', '2024-05-07 10:01:32', 'Extra Strength Unscented är en oparfymerad kattsand av högsta kvalitet med maximal klumpbildningsförmåga, vilket förhindrar urinen från att tränga sig igenom och lägga sig på botten av lådan där det bildas bakterier som gör att det börjar lukta. Kattsanden passar både katter och kattägare som är känsliga för parfym. Kattsandens alla korn innehåller aktivt kol, vilket bidrar till att fånga upp och neutralisera de molekyler som orsakar dålig lukt. Kattsanden innehåller endast naturliga mineraler och lera, bland annat bentonitlera och ett antimikrobiellt ämne som tillsätts för att förhindra tillväxten av odörorsakande bakterier. 10 kg.', 'Extra Strong Unscented Kattsand', '', 'publish', 'open', 'closed', '', 'extra-strong-unscented-kattsand', '', '', '2024-05-07 10:01:32', '2024-05-07 10:01:32', '', 0, 'http://petpalace.test/?post_type=product&#038;p=120', 0, 'product', '', 0),
