(128, 1, '2024-05-07 10:09:51', '2024-05-07 10:09:51', 'Våra hundar och katters klor växer ständigt och dem kan behöva lite hjälp på traven att klippa dessa så att dem inte blir för långa. Denna klotång är en praktisk och behändig klotång av rostfritt stål och bekväma plasthandtag. Var noga med att inte klippa i pulpan (den blodförsedda delen av klon) och klipp hellre lite och ofta istället för mycket och sällan!', 'Klotång', '', 'publish', 'open', 'closed', '', 'klotang', '', '', '2024-05-07 10:09:51', '2024-05-07 10:09:51', '', 0, 'http://petpalace.test/?post_type=product&#038;p=128', 0, 'product', '', 0),
(129, 1, '2024-05-07 10:09:25', '2024-05-07 10:09:25', '', '48', '', 'inherit', 'open', 'closed', '', '48', '', '', '2024-05-07 10:09:25', '2024-05-07 10:09:25', '', 128, 'http://petpalace.test/wp-content/uploads/2024/05/48.png', 0, 'attachment', 'image/png', 0),
(130, 1, '2024-05-07 10:11:46', '2024-05-07 10:11:46', 'Att jaga är ett naturligt beteende för alla katter. House mus är fyll med kattmynta och prasslande material, vilket gör leken extra rolig. De olika texturerna gör jakten verklighetstrogen, och stimulerar din katts jaktbehov. Storlek: 6 x 5 x 20 cm\r\n\r\nKom ihåg! Vissa av våra sällskapsdjur är starkare än vi tror. Håll katten under uppsikt när den leker, och ta bort leksaken om den går sönder. Tänk på att anpassa storleken på leksaken efter hur stort ditt djur är, lagom är alltid bäst.', 'House mus', '', 'publish', 'open', 'closed', '', 'house-mus', '', '', '2024-05-07 10:11:47', '2024-05-07 10:11:47', '', 0, 'http://petpalace.test/?post_type=product&#038;p=130', 0, 'product', '', 0),
